    { id: 'Shoes', label: 'Shoes' },
    { id: 'Clothes', label: 'Clothing products' },
    { id: 'Games', label: 'Gaming products' },
    { id: 'Sport', label: 'Sports products'},
    { id: 'Tech', label: 'Tech products'},
    { id: 'Other', label: 'Other products' }
